<script lang="ts">
import { defineComponent } from "vue";

export default defineComponent({
  name: "FlagLogo",
  mounted() {
    const flagClass = document.cookie
      .split("; ")
      .find((row) => row.startsWith("flag="))
      ?.split("=")[1];
    if (flagClass !== undefined) {
      this.selectFlag(flagClass);
    }
  },
  methods: {
    selectFlag(flagClass: string) {
      // set the user's preferred flag as a cookie
      document.cookie = "flag=" + flagClass + ";samesite=strict;";

      const flags = document?.querySelectorAll(".flags > g");
      flags?.forEach((flag) => {
        if (flag.classList.contains(flagClass + "-flag")) {
          flag.removeAttribute("display");
        } else {
          flag.setAttribute("display", "none");
        }
      });
    },
  },
});
</script>

